@use "../abstracts/index" as *;
*,
*::before,
*::after {
  padding: 0;
  margin: 0;
  box-sizing: border-box;
}
html {
  @media only screen and (max-width: 1500px) {
    font-size: 90%;
  }
  @media only screen and (max-width: 1100px) {
    font-size: 80%;
  }
  @media only screen and (max-width: 800px) {
    font-size: 70%;
  }
}
body {
  background-color: $main-beige;
  width: 100vw;
  height: 100vh;
}
.container {
  display: flex;
  flex-direction: column;
  height: 100%;
  width: 100%;
}

.header,
.footer {
  flex: 0 0 5%;

  background-color: $main-white;
}
.header {
  border-bottom: $main-border-black;
  width: 100%;

  display: flex;
  justify-content: flex-start;

  @media only screen and (max-width: 1000px) {
    flex-wrap: wrap;
    justify-content: center;
    align-items: center;
    & > * {
      width: 100%;
    }
  }
}
.content {
  height: auto;
  flex: 1;

  display: flex;
  flex-wrap: wrap;
}
.footer {
  border-top: $main-border-black;

  display: flex;
}

