@use "../abstracts/index" as *;

.header {
  .logo {
    display: flex;
    justify-content: center;
    align-items: center;

    cursor: pointer;
    &__img {
      @include border-active-black;

      max-height: 5rem;
    }

    &__text {
      text-align: center;
      box-sizing: border-box;

      @include underline-hover-black;
      @include border-active-black;
    }
  }
  .nav {
    flex: 1;

    display: flex;
    flex-direction: row;
    align-items: center;
    justify-content: flex-end;
    gap: clamp(0.5rem, 1rem + 3vw, 6rem);
    margin-right: 1rem;
    &__item {
      list-style-type: none;
      @include underline-hover-black;
      @include border-active-black;

      & a,
      & a:link,
      & a:visited {
        text-decoration: none;
        color: inherit;
      }
    }

    &__item:not(:last-child) {
    }

    @media only screen and (max-width: 1000px) {
      justify-content: center;
      margin: 0;
    }
  }
}

sources.sass\\abstracts\\_mixins.scss:
@use "colors" as *;

@mixin underline-hover-black {
  &:hover {
    text-decoration: underline solid $main-black;
  }
}
@mixin border-active-black {
  border: solid 0.2rem rgba(0, 0, 0, 0);

  &:active {
    text-decoration: none;
    border: none;
    border: $active-border-black;
  }
}

sources.sass\\components\\_btn-2d.scss:
@use "../base/animations" as *;
@use "../abstracts/index" as *;
.btn-2d {
  background-color: $main-white;

  margin-left: 6rem;
  margin-top: 1rem;
  width: 8rem;
  height: 2.5rem;
  position: relative;
  @include border-active-black;
  border: solid 0.15rem $main-black;

  overflow: hidden;
  cursor: pointer;
  & > * {
    display: inline-block;
    height: 100%;
    width: 100%;
    transition: all 0.2s;
    padding-top: 0.4rem;
  }
  &__invisible {
    position: absolute;
    left: 0;
    top: -100%;
  }
  &:active {
    animation: 0.2s buttonClick;
  }
  &:hover &__visible {
    transform: translateY(100%);
  }
  &:hover &__invisible {
    top: 0;
  }
  @media only screen and (max-width: 1000px) {
    margin-left: 0;
  }
}

